import React from "react";
import { Progress } from "reactstrap";

const ReacherProgress = (props) => {
  var progress = 50;
  return (
    <div>
      <div className="text-center">{progress}%</div>
      <Progress value={progress} />
    </div>
  );
};

export default ReacherProgress;
